(31235, '狗', '混種狗', '公', '黑黃色', '中型', '2022-05-17', '2021-04-10', '臺北市內湖區潭美街852號', '是', '否', '', '內湖路1段47巷', 'OPEN', '已絕育，可碰觸及撫摸，害羞 乖(所內絕育)', '2015-06-03', 'https://asms.coa.gov.tw/amlapp/upload/pic/30d5faeb-b47d-4fc2-8c61-61017d5271a3_org.jpg', '02-87913254', '臺北市', '臺北市動物之家'),
