(31237, '狗', '混種狗', '公', '黑色', '中型', '2022-05-13', '2015-11-18', '臺北市內湖區潭美街852號', '是', '否', '', '木柵路2段109巷', 'OPEN', '(所內絕育)', '2015-06-09', 'https://asms.coa.gov.tw/amlapp/upload/pic/16717_104060908_1_org.jpg', '02-87913254', '臺北市', '臺北市動物之家'),
(31239, '狗', '混種狗', '公', '黑色', '小型', '2022-05-06', '2015-07-09', '臺北市內湖區潭美街852號', '是', '否', '', '至善路3段150巷21弄', 'OPEN', '(所內絕育)', '2015-06-15', 'https://asms.coa.gov.tw/amlapp/upload/pic/16813_104061512_10_org.jpg', '02-87913254', '臺北市', '臺北市動物之家'),
(31242, '狗', '混種狗', '母', '黃色', '中型', '2022-05-06', '2015-07-19', '臺北市內湖區潭美街852號', '是', '否', '', '中山北路七段', 'OPEN', '哈囉，我叫小羽~我是個溫柔有點害羞的女生，體型偏小。我的右後腳有切除一小段(股骨頭切除)，但我都能正常走路散步唷~你想要一隻Nice的狗狗嗎，選我就對了！我在動物之家等著你~快來唷!(所內絕育)', '2015-07-18', 'https://asms.coa.gov.tw/amlapp/upload/pic/376c157b-da5a-4b20-84fc-45c134ad2b67_org.jpg', '02-87913254', '臺北市', '臺北市動物之家'),
(31246, '狗', '混種狗', '公', '黑色', '中型', '2022-06-06', '2016-02-05', '臺北市內湖區安美街191號', '是', '否', '', '福德坑公墓', 'OPEN', '我是牛哥/小丸子在動物之家兩年多了(104.7.29進所)很可惜還沒遇到有緣人我其實很平易近人對熟悉的人也很撒嬌哦能不能也給我機會表現呢？(所內絕育)；「該動物暫時收容於原址，無開放參訪，如欲認養請填寫表單(https://reurl.cc/OA6dry)，由專人與您聯絡預約互動時間。」', '2015-07-29', 'https://asms.coa.gov.tw/amlapp/upload/pic/308c0714-53b9-4865-8015-6c7a861583c0_org.jpg', '02-87913254', '臺北市', '臺北市動物之家'),
(31248, '狗', '混種狗', '公', '黑色', '中型', '2022-05-18', '2015-12-20', '臺北市內湖區潭美街852號', '是', '否', 'ADULT', '承德路二段', 'OPEN', '友善，可碰，乖，左前肢傷口，後肢骨折，心絲蟲您好，我是大東。就在前幾個週末，因為有人看我好像變瘦帶我檢查，結果發現我有心絲蟲。住了那麼久，中了大家可能不會想認養的病，我還有被治療的機會嗎？我想懷抱希望！因為我本來就是樂觀的狗狗。大東精神活潑，不像年紀很大的狗狗，帥、好奇心重、勇敢，他是工作人員帶出來，第一個自己跑到兩層推車上，還可以推著玩的狗狗，在籠子裡有時會自己推著碗玩滑壘，非常有趣^^會坐下、握手。你願意和他一起走很久很久嗎 <3(所內絕育)', '2015-08-04', 'https://asms.coa.gov.tw/amlapp/upload/pic/eee1e0bb-2c6f-47a2-8089-c5a8e231dcad_org.jpg', '02-87913254', '臺北市', '臺北市動物之家'),
(31249, '狗', '混種狗', '公', '黑色', '小型', '2022-06-07', '2021-04-10', '臺北市內湖區安美街191號', '是', '否', '', '菁山路101巷', 'OPEN', '「該動物暫時收容於原址，無開放參訪，如欲認養請填寫表單(https://reurl.cc/OA6dry)，由專人與您聯絡預約互動時間。」全身皮膚病(已絕育)(所內絕育)', '2015-08-06', 'https://asms.coa.gov.tw/amlapp/upload/pic/d3491267-eb85-4e3d-bcb7-ae4afe6fba52_org.jpg', '02-87913254', '臺北市', '臺北市動物之家'),
(31251, '狗', '混種狗', '母', '棕色', '中型', '2022-05-18', '2021-04-10', '臺北市內湖區潭美街852號', '是', '否', '', '陽明山遊客中心第二停車場', 'OPEN', '緊張大家好~ 我是土豆，我的個性害羞有些膽怯，雖然對這個環境已經熟悉了，但還是顯得緊張內向，我需要的是愛，讓我知道這是專屬我的，感到安全感、給我自信，我要主人的陪伴，已經等一年多好久了，我可以上牽繩散步，你願意來看看我嗎，讓我有機會展現我的進步吧~做個小公主^^(所內絕育)', '2015-08-11', 'https://asms.coa.gov.tw/amlapp/upload/pic/17400_104081106_5_org.jpg', '02-87913254', '臺北市', '臺北市動物之家'),
