(31260, '狗', '', '公', '虎斑色', '中型', '2022-06-07', '2021-04-10', '臺北市內湖區安美街191號', '是', '否', '', '碧山路', 'OPEN', '「該動物暫時收容於原址，無開放參訪，如欲認養請填寫表單(https://reurl.cc/OA6dry)，由專人與您聯絡預約互動時間。」 104.9.27犬八合一已絕育', '2015-09-27', 'https://asms.coa.gov.tw/amlapp/upload/pic/51f1f10c-b1b3-46a2-941e-b29c2a996db2_org.jpg', '02-87913254', '臺北市', '臺北市動物之家'),
