(31262, '狗', '混種狗', '公', '虎斑色', '中型', '2022-05-13', '2021-04-11', '臺北市內湖區潭美街852號', '是', '否', '', '菁山路101巷', 'OPEN', '(所內絕育)', '2015-10-04', 'https://asms.coa.gov.tw/amlapp/upload/pic/17903_104100402_5_org.jpg', '02-87913254', '臺北市', '臺北市動物之家'),
(31264, '狗', '混種狗', '公', '黑白色', '中型', '2022-05-18', '2021-04-10', '臺北市內湖區潭美街852號', '是', '否', '', '前山公園', 'OPEN', '106.10.19已絕育(所內絕育)', '2015-10-05', 'https://asms.coa.gov.tw/amlapp/upload/pic/0655f990-9053-4de3-a6d2-b810db9caed7_org.jpg', '02-87913254', '臺北市', '臺北市動物之家'),
(31265, '狗', '混種狗', '公', '虎斑色', '中型', '2022-05-15', '2021-04-10', '臺北市內湖區潭美街852號', '是', '否', '', '文昌路', 'OPEN', '友善，可碰，緊張，乖你好~ 我是有著美麗膚色的琥珀。等呀等~ 我的個性比較獨立，不會跟每個人都親近，但不代表我不喜歡跟你親近，我只是正等著一個契合的人。希望在時間培養下，我也有一個有點黏又不會太黏的好夥伴，相伴一生。喜歡虎斑狗狗的朋友，請給我一個機會唷！(所內絕育)', '2015-10-07', 'https://asms.coa.gov.tw/amlapp/upload/pic/3f136140-fa83-4eb6-8533-8eac4f6c406b_org.jpg', '02-87913254', '臺北市', '臺北市動物之家'),
(31266, '狗', '混種狗', '母', '虎斑色', '中型', '2022-05-17', '2021-04-11', '臺北市內湖區潭美街852號', '是', '否', '', '研究院路一段130巷', 'OPEN', '(所內絕育)我是阿薰個性內向靦腆害羞的我比較不敢直接與你們互動但還是會想嘗試上前聞聞你們唷熟悉後就可以摸摸我雖然需要一點時間但希望你們可以給我一個機會～', '2015-10-08', 'https://asms.coa.gov.tw/amlapp/upload/pic/17966_104100808_1_org.jpg', '02-87913254', '臺北市', '臺北市動物之家'),
