(31475, '狗', '混種狗', '母', '黑白色', '中型', '2022-05-18', '2017-05-21', '臺北市內湖區潭美街852號', '是', '否', '', '新光路2段', 'OPEN', '我是小菲，我很內向，比較容易緊張，會跟你保持距離，但不會攻擊，慢慢來我們可以一起散步。花些時間多幾次跟我互動、講講話、摸摸我，讓我知道你對我好，我會是很乖的隻陪伴犬唷，相信將來我也可以開心的搖尾巴。(所內絕育)', '2017-01-02', 'https://asms.coa.gov.tw/amlapp/upload/pic/46f635eb-7a38-478a-99b7-ddef0df11822_org.jpg', '02-87913254', '臺北市', '臺北市動物之家'),
