(31497, '狗', '', '公', '黃白色', '中型', '2022-06-07', '2017-02-03', '臺北市內湖區安美街191號', '是', '否', '', '民眾不擬續養', 'OPEN', '哈囉~我叫威利，我個性溫馴，但對陌生人有戒心，如果比較靠近可能會有攻擊的行為，所以要先多跟我培養感情唷!!「該動物暫時收容於原址，無開放參訪，如欲認養請填寫表單(https://reurl.cc/OA6dry)，由專人與您聯絡預約互動時間。」(非所內絕育)', '2017-02-03', 'https://asms.coa.gov.tw/amlapp/upload/pic/22958_106020301_1_org.jpg', '02-87913254', '臺北市', '臺北市動物之家'),
