(31647, '狗', '混種狗', '公', '白色', '中型', '2022-05-15', '2021-04-10', '臺北市內湖區潭美街852號', '是', '否', '', '南港機場', 'OPEN', '鼻傷、瘦(所內絕育)', '2017-08-07', 'https://asms.coa.gov.tw/amlapp/upload/pic/a1a2e739-66e1-4825-8055-b7da34d353a2_org.jpg', '02-87913254', '臺北市', '臺北市動物之家'),
(31650, '狗', '混種狗', '公', '黑色', '中型', '2022-05-18', '2017-08-08', '臺北市內湖區潭美街852號', '是', '否', '', '民眾不擬續養', 'OPEN', '你好~ 我是龐克。我有點像貓咪那樣很認環境，也可能因為在收容所環境久了，一下子轉換到家庭環境，沒辦法那麼快適應。加上本來就對聲音、動作敏感，另外有點護食。希望帶我回家的人，是接受我適應期比較長、開始都會很緊繃，無法表現正常，或是更有經驗方式應對我這樣狀態的狗狗唷。我也很希望我趕快適應家庭進入家庭，請幫忙祝福我~(所內絕育)', '2017-08-08', 'https://asms.coa.gov.tw/amlapp/upload/pic/592b99f3-3f80-407d-b9ce-36268a2845ea_org.jpg', '02-87913254', '臺北市', '臺北市動物之家'),
(31654, '狗', '', '母', '黑白色', '中型', '2022-06-07', '2017-12-21', '臺北市內湖區安美街191號', '是', '否', '', '動物之家', 'OPEN', '106.12/14絕育  1070518右前掌淺傷(所內絕育) 「該動物暫時收容於原址，無開放參訪，如欲認養請填寫表單(https://reurl.cc/OA6dry)，由專人與您聯絡預約互動時間。」', '2017-08-10', 'https://asms.coa.gov.tw/amlapp/upload/pic/d8be9762-7161-4097-98de-e6de476dc6ca_org.jpg', '02-87913254', '臺北市', '臺北市動物之家'),
(31655, '狗', '混種狗', '母', '黑色', '中型', '2022-06-03', '2021-04-10', '臺北市內湖區安美街191號', '是', '否', '', '瑞光路', 'OPEN', '你打算找一隻一起運動的狗狗嗎，鬼鬼會很適合你的需求，她活動量大，需要到大空間大場地動動，喜歡跑跳、探索、力氣衝勁大！年輕狗狗需要消耗精力，身心才會健康。她的個性熱情活潑。鬼鬼親狗，看到狗就想趕快去認識，快跟她玩。鬼鬼親近人，你離開她會癡癡望著門口，等待你從那裡進來。玩完了，她可以在你旁邊休息，但你一有動靜，她馬上也動。會注意你的舉動，也會注意周遭的動靜。這麼貼心、年輕、活動力量十足的鬼鬼，是你想要的嗎？？他正在動物之家等著你來認識！(所內絕育)「該動物暫時收容於原址，無開放參訪，如欲認養請填寫表單(https://reurl.cc/OA6dry)，由專人與您聯絡預約互動時間。」', '2017-08-12', 'https://asms.coa.gov.tw/amlapp/upload/pic/25743_106081205_2_org.jpg', '02-87913254', '臺北市', '臺北市動物之家'),
(31661, '狗', '混種狗', '公', '棕色', '中型', '2022-06-03', '2021-04-10', '臺北市內湖區安美街191號', '是', '否', '', '民眾不擬續養', 'OPEN', '(所內絕育)「該動物暫時收容於原址，無開放參訪，如欲認養請填寫表單(https://reurl.cc/OA6dry)，由專人與您聯絡預約互動時間。」', '2017-08-20', 'https://asms.coa.gov.tw/amlapp/upload/pic/25828_106082013_1_org.jpg', '02-87913254', '臺北市', '臺北市動物之家'),
(31666, '狗', '混種狗', '母', '黃白色', '中型', '2022-07-29', '2017-09-17', '臺北市內湖區安美街191號', '是', '否', 'ADULT', '民眾不擬續養', 'OPEN', '大家好，我是檸檬，我的個性很撒嬌、黏人，照顧很好的我不論皮膚毛色精神都很不錯，我正在等待你來跟我互動，感受乖狗狗的甜蜜唷 <3(所內絕育)', '2017-08-25', 'https://asms.coa.gov.tw/amlapp/upload/pic/9a3d1220-bc8e-46ca-aa4e-6240aede18c2_org.jpg', '02-87913254', '臺北市', '臺北市動物之家'),
(31667, '狗', '混種狗', '母', '黃色', '中型', '2022-06-07', '2021-04-10', '臺北市內湖區安美街191號', '是', '否', 'ADULT', '錦西街', 'OPEN', '友善，可碰，坐下，握手，換手，愛吃-----------------我是妞妞我的個性很友善會主動親近及撒嬌而且我很聰明懂得坐下、握手還有換手的指令唷先來跟我互動看看吧！「該動物暫時收容於原址，無開放參訪，如欲認養請填寫表單(https://reurl.cc/OA6dry)，由專人與您聯絡預約互動時間。」(所內絕育)', '2017-08-26', 'https://asms.coa.gov.tw/amlapp/upload/pic/25899_106082602_1_org.jpg', '02-87913254', '臺北市', '臺北市動物之家'),
(31669, '狗', '', '公', '黑白色', '中型', '2022-06-07', '2017-09-01', '臺北市內湖區安美街191號', '是', '否', '', '民眾不擬續養', 'OPEN', '大家好~我的名字叫黑豆，我的個性害羞、怕生，希望剛進到動物之家的我，能很快的再次找到溫暖的家~「該動物暫時收容於原址，無開放參訪，如欲認養請填寫表單(https://reurl.cc/OA6dry)，由專人與您聯絡預約互動時間。」(所內絕育)', '2017-08-29', 'https://asms.coa.gov.tw/amlapp/upload/pic/b14c54e7-f3bc-4526-9cac-5efa7724a2b1_org.jpg', '02-87913254', '臺北市', '臺北市動物之家'),
